import React, { useState, useEffect } from 'react';
import { View, Text } from 'react-native';
import { headers, basicStyles } from 'styles';
import { colors } from 'styles';
import CountUp from 'react-countup';

export default function QuickStats({ data }) {
    return (
        <View style={{ flex: 1, marginTop: 30, marginBottom: 100, width: '100%' }}>
            <Text
                fontWeight={'bold'}
                style={[headers.H2(colors.lightText()), { marginTop: 30, marginLeft: 30, marginBottom: 50, textAlign: 'center' }]}
            >
                Quick statistics:
            </Text>
            <View style={{ flex: 1, flexDirection: 'row', justifyContent: 'space-between' }}>
                <View style={{ flex: 1, alignItems: 'center' }}>
                    <View style={{ flex: 1, alignItems: 'center' }}>
                        <CountUp end={data.averageWorkoutTime * 60} duration={6} delay={0}>
                            {({ countUpRef }) => <span style={{ ...headers.H1('black') }} ref={countUpRef} />}
                        </CountUp>
                        <Text style={[headers.H5(colors.lightText(), 'Light')]}>Average minutes worked </Text>
                    </View>
                    <View style={{ flex: 1, alignItems: 'center', marginTop: 30 }}>
                        <CountUp end={data.totalWorkoutPlansWithCompletionRate} duration={6} delay={0}>
                            {({ countUpRef }) => <span style={{ ...headers.H1('black') }} ref={countUpRef} />}
                        </CountUp>
                        <Text style={[headers.H5(colors.lightText(), 'Light')]}>Total completed workout plans</Text>
                    </View>
                </View>
                <View style={{ flex: 1, alignItems: 'center' }}>
                    <View style={{ flex: 1, alignItems: 'center' }}>
                        <CountUp end={data.totalFinishedDailyWorkouts} duration={6} delay={0}>
                            {({ countUpRef }) => <span style={{ ...headers.H1('black') }} ref={countUpRef} />}
                        </CountUp>
                        <Text style={[headers.H5(colors.lightText(), 'Light')]}>Total finished daily workouts</Text>
                    </View>
                    <View style={{ flex: 1, alignItems: 'center', marginTop: 30 }}>
                        <CountUp end={data.totalFailedDailyWorkouts} duration={6} delay={0}>
                            {({ countUpRef }) => <span style={{ ...headers.H1('black') }} ref={countUpRef} />}
                        </CountUp>
                        <Text style={[headers.H5(colors.lightText(), 'Light')]}>Total failed daily workouts</Text>
                    </View>
                </View>
            </View>
        </View>
    );
}
